import React from "react";
import "./component-styles/card.css";
import FlightTicket from "./FlightTicket";
import { tickets } from "../scripts/data";

const TicketList = () => {
  let ticketsArray = [];

  tickets().then((data) => {
    data.sort((a, b) => {
      return a.price - b.price;
    });

    for (let i = 0; i < 5; i++) {
      ticketsArray.push(
        <li>
          <FlightTicket ticket={data[i]} />
        </li>
      );
    }
  });

  return <ul>{ticketsArray}</ul>;
};

export default TicketList;
